import React from "react";

const Contact=()=>{
    return(
        <>
        <div className="contact_form">
          <h1>Contact us</h1>
            <form>
                <label for="nom">Nom</label>
                <input type="text" id="nom" name="fname" />
               
            </form>
        </div>
        </>
    )
}
export default Contact;
